import React from 'react';
import ExperiencesCart from './ExperiencesCart';
import s from './Experiences.module.css';

function Experiences(props) {

    let carts =
        props.carts.map(c => <ExperiencesCart companyName={c.companyName}
            companyImageSrc={c.companyImageSrc}
            job={c.job}
            jobExperience={c.jobExperience}
            impressions={c.impressions} />);


    return (
        <div className={s.body}>
            <div className={s.experiences_cart}>
                <div className={s.title_div}>

                    <span id={s.company_name}>{props.carts[0].companyName}</span>
                    <br />
                    <img id={s.company_img} src={props.carts[0].companyImageSrc} alt='facebook' />

                </div>

                <span id={s.job}>{props.carts[0].job}</span>

                <span id={s.date}>{props.carts[0].jobExperience}</span>

                <br />
                <span id={s.impressions}>{props.carts[0].impressions}</span>
            </div>
        </div>
    );
}

export default Experiences;
